import React from 'react'
import TweetBox from './Tweetbox.js'
import './Feed.css'
import Post from '../post/Post.js'
const axios = require('axios');
function Feed(userData) {



    return (
        <div className="feed">
            {/* Header */}
            <div className="feed__header">
                <h2>Home</h2>
            </div>



            {/* TweetBox */}

            <TweetBox/>
            { axios({
                method: 'get',
                    url: `http://localhost:8000/posts/?userId=+${userData.userData._id}`,
                    headers: {
                        "Access-Control-Allow-Origin": "*"
                },


                }).then(post=>{
                    console.log(post.data)
                    post.data.map(post=>{
                        return console.log(post)
                    })


                }).catch(err => { console.log(err) })}
            <Post displayName={userData.userData.name} displayHandle={userData.email}/>
            <Post />
            <Post />
            <Post />

        </div>
    )
}

export default Feed
